import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

import Dashboard from "./pages/admin/Dashboard";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="admin/dashboard" element={<Dashboard />} />
        <Route path="admin/data-dokter" element={<Dashboard />} />
      </Routes>
    </Router>
  );
}

export default App;
